import './Header.css';
import logo from '../../images/CC-UIE-black-logo.png';

function Navbar(){
  return (
    <div id="Header">
        <img className='img-resp' alt='centerCentre' src={logo} />



      <a className="btn btn-custom btn-shadow" href="#pricing">Enroll Now</a>

    </div>


  );
}

export default Navbar;
